import React, { PureComponent } from 'react';
import HotComment from './HotComment.js';
import PublicPraise from './PublicPraise.js';
import OTAComment from './OTAComment.js';
export default class PublicPriseContent extends PureComponent {
    render() {
        return (
            <div className="content">
                <div className="chart-area-one-third" style={{marginBottom:'2%'}}>
                    <div className="chart-title">评论热度满意度趋势</div>
                    <HotComment></HotComment>
                </div>
                <div className="chart-area-one-third" style={{marginBottom:'2%'}}>
                    <div className="chart-title">综合口碑指数</div>
                    <PublicPraise></PublicPraise>
                </div>
                <div className="chart-area-one-third">
                    <div className="chart-title">OTA评论分布</div>
                    <OTAComment></OTAComment>
                </div>
            </div>
        );
    }
}
